  return (
    <Section>
      <div className="movies-card-container">
        <div className="movies-card-list">
          <MoviesCard />
          <MoviesCard />
          <MoviesCard />
          <MoviesCard />
          <MoviesCard />
        </div>
        <button className="movies-card-list__still">Ещё</button>
      </div>
    </Section>
  );
}

export default MoviesCardList;
